import { ClosedCaption, Home, SupervisorAccount, TableChart } from '@material-ui/icons';
import React from 'react';

export const SideMenuData = [
    {
        title: "Home",
        icon: <Home />,
        link: "/home"
    },
    {
        title: "Associations",
        icon: <TableChart />,
        link: "/associations"
    },
    {
        title: "Under Admins",
        icon: <SupervisorAccount />,
        link: "/admins"
    },
    {
        title: "Associations Disable",
        icon: <ClosedCaption />,
        link: "/associations_disable"
    },
    {
        title: "Admins Disable",
        icon: <ClosedCaption />,
        link: "/admins_disable"
    },
]
